const opgpErrorHandler = function(opgp,type){
  if(opgp){
    throw (errorFinder(type))
	} else {
		return false
	}
}

const errorFinder = function(error){
  for(i = 0; i < errorDict.length; i++){
    if((errorDict[i].input).search(error) > -1){
      return errorDict[i].output
    }
  }
}

